import Employe from './components/employe/Employe';
import ListConge from './components/conge/ListConge';

const routes = [
    {
        id: 1,
        path: '/employe',
        component: Employe,
        nom: 'employe'
    },
    {
        id: 2,
        path: '/listConge',
        component: ListConge,
        nom: 'listconge'
    }
]


export default routes;
